import React from 'react';

function ButtonContainer(props) {
    //current

    return (
        <div className="button-container">
            <p className="button account-active"></p>
            <span>
                <button onClick={props.all} className='button all-button'>All</button>
                <button onClick={props.active} className='button active-button'>Active</button>
                <button onClick={props.completed} className='button completed-button'>Completed</button>
            </span>
            <button onClick={props.clearComplered} className='button clear-complered'>Clear complered</button>
        </div>
    );
}

export default ButtonContainer;
